-- Pune Ward Boundaries Import Script
-- Run this in your PostgreSQL database

-- Create table for ward polygons
DROP TABLE IF EXISTS public.ward_polygons CASCADE;

CREATE TABLE public.ward_polygons (
  id SERIAL PRIMARY KEY,
  ward_number INTEGER,
  ward_text VARCHAR(20),
  ward_office VARCHAR(100),
  prabhag_name VARCHAR(255),
  zone INTEGER,
  zone_id INTEGER,
  prabhag_id INTEGER,
  geometry GEOMETRY(MultiPolygon, 4326),
  area_km2 NUMERIC,
  tree_count INTEGER DEFAULT 0,
  created_at TIMESTAMP DEFAULT NOW()
);

-- Create spatial index
CREATE INDEX idx_ward_polygons_geom ON public.ward_polygons USING GIST(geometry);
CREATE INDEX idx_ward_polygons_number ON public.ward_polygons(ward_number);

-- Insert ward data

-- Calculate area for each ward
UPDATE public.ward_polygons SET area_km2 = ST_Area(geometry::geography) / 1000000;

-- Update tree count from trees table
UPDATE public.ward_polygons wp SET tree_count = (
  SELECT COUNT(*) FROM public.trees t 
  WHERE FLOOR(t.ward::numeric) = wp.ward_number
);

-- Verify import
SELECT ward_number, ward_text, ward_office, tree_count, ROUND(area_km2::numeric, 2) as area_km2, ST_IsValid(geometry) as is_valid FROM public.ward_polygons ORDER BY ward_number;